import React from "react";
import { Navbar, Container, Nav, NavDropdown, Button, Form, FormControl, Offcanvas} from "react-bootstrap"; 
import 'bootstrap/dist/css/bootstrap.min.css';
import { useState } from "react";
import { useEffect } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";
import './NavBar.css';

export default function NavBar(props) {
    const [formInput, setFormInput] = useState('');
    const [username, setUsername] = useState(null);
    const navigate = useNavigate();

    useEffect(function() {
        axios.get('/api/user/isLoggedIn')
        .then(response => setUsername(response.data.username))
        .catch(error => console.log("User is not logged in " + username));
    }, [username])

    async function logout(){
        let promise = new Promise((resolve, reject) => {
            axios.post('/api/user/logout')
            .then(reponse => {
                resolve(null);
            })
            .catch(error => reject('Error logging out'));
        });
        let result = await promise;
        if (result === null){
            setUsername(result);
            navigate('/')
        }
    }


    function underDropDown(){
        if (username){
            return (
                <NavDropdown title={username} id="navbarScrollingDropdown">
                <NavDropdown.Item href={"/userAccount/" + username} >User Account</NavDropdown.Item>
                <NavDropdown.Item href="#action4">My Reviews</NavDropdown.Item>
                <NavDropdown.Item onClick={logout}>Log Out</NavDropdown.Item>
                </NavDropdown>

            )
        } else {
            return (
                <NavDropdown title='Register Or Log In' id="navbarScrollingDropdown">
                <NavDropdown.Item href='/createUser'>Create New Account</NavDropdown.Item>
                <NavDropdown.Item href="/login">Log In</NavDropdown.Item>
                </NavDropdown>
            )
        }
    }

    return (
        <div className='navBar'>
        <Navbar bg="light" expand="lg" >
        <Container fluid className="nana">
            <Navbar.Brand href="/">FoodReviewApp</Navbar.Brand>
            <Navbar.Toggle aria-controls="navbarScroll" />
            <Navbar.Collapse id="navbarScroll">
            <Nav
                className="me-auto my-2 my-lg-0"
                style={{ maxHeight: '100px' }}
                navbarScroll
            >
                <Nav.Link href="/">Home</Nav.Link>
                <Nav.Link href="#action2">Top Dish</Nav.Link>
                {underDropDown()}
            </Nav>
            <Navbar.Toggle aria-controls="offcanvasNavbar" />
    <Navbar.Offcanvas
      id="offcanvasNavbar"
      aria-labelledby="offcanvasNavbarLabel"
      placement="end"
    >
      <Offcanvas.Header closeButton>
        <Offcanvas.Title id="offcanvasNavbarLabel">Offcanvas</Offcanvas.Title>
      </Offcanvas.Header>
      <Offcanvas.Body>
        <Nav className="justify-content-end flex-grow-1 pe-3">
          <Nav.Link href="#action1">Home</Nav.Link>
          <Nav.Link href="#action2">Link</Nav.Link>
          <NavDropdown title="Dropdown" id="offcanvasNavbarDropdown">
            <NavDropdown.Item href="#action3">Action</NavDropdown.Item>
            <NavDropdown.Item href="#action4">Another action</NavDropdown.Item>
            <NavDropdown.Divider />
            <NavDropdown.Item href="#action5">
              Something else here
            </NavDropdown.Item>
          </NavDropdown>
        </Nav>
        <Form className="d-flex">
          <FormControl
            type="search"
            placeholder="Search"
            className="me-2"
            aria-label="Search"
          />
          <Button variant="outline-success">Search</Button>
        </Form>
      </Offcanvas.Body>
    </Navbar.Offcanvas>
            <Form className="d-flex">
                <FormControl
                type="text"
                value={formInput}
                onChange={(e) => setFormInput(e.target.value)}
                placeholder="Search"
                className="me-2"
                aria-label="Search"
                />
                <Button 
                variant="outline-success"
                >
                Search</Button>
            </Form>
            </Navbar.Collapse>
        </Container>
        </Navbar>
        </div>
    )
}
